import { useState } from "react";

const Example = () => {
  const [val, setVal] = useState("");
  console.log(val);
  return (
    <>
      <h2>Reminder</h2>
      <input
        type="text"
        value={val}
        onChange={(e) => setVal(e.target.value)}
      ></input>
      <button>追加</button>
    </>
  );
};

export default Example;
